const CACHE_NAME="game-dashboard-v1",URLS_TO_CACHE=["/","/index.html","/manifest.json","/dist/styles.min.css","/dist/bundle.min.js","/icons/site.webmanifest","/icons/android-chrome-192x192.png","/icons/android-chrome-512x512.png","/icons/apple-touch-icon.png","/icons/favicon-16x16.png","/icons/favicon-32x32.png","/icons/favicon.ico"];self.addEventListener("install",(e=>{self.skipWaiting(),e.waitUntil(async function(){const e=await caches.open(CACHE_NAME);await e.addAll(URLS_TO_CACHE)}())})),self.addEventListener("activate",(e=>{e.waitUntil(async function(){const e=await caches.keys();await Promise.all(e.filter((e=>e!==CACHE_NAME)).map((e=>caches.delete(e))));try{await self.clients.claim()}catch(e){}}())})),self.addEventListener("fetch",(e=>{e.respondWith((async()=>{if("navigate"===e.request.mode)return(await caches.open(CACHE_NAME)).match("/index.html");const s=await caches.open(CACHE_NAME);return await s.match(e.request)||fetch(e.request).then((t=>t&&200===t.status&&"basic"===t.type?(s.put(e.request,t.clone()),t):t)).catch((()=>new Response("You are currently offline.",{status:503,statusText:"Service Unavailable"})))})())}));